import React from "react";
import './../../styles/style.css';


function NavButtons(): any {
    return (
        <div className={'flx-container'}>
            <div className={'mg-s1'}>
                <span>All projects</span>
            </div>
            <div className={'mg-s1'}>
                <span>Workflow</span>
            </div>
        </div>
    );
}

export default NavButtons
